// WA Notif
window.addEventListener("load", function () {
    var audio = document.createElement("audio");
    audio.src = "../audio/whatsapp.mp3";
    audio.preload = "auto";
    audio.addEventListener("canplaythrough", function () {
        setTimeout(function () {
            audio.play();
            $('.floatingWA').addClass("animation")
                .one("webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend", function () {
                    $(this).removeClass("animation");
                });
            $(".notifyWA").toggle();
        }, 2000);
    }, false);
}, false);

$('#modalBeli').on('show.bs.modal', function (event) {
    $('#input_paket').val($(event.relatedTarget).data('paket'));
    $('#input_harga').val($(event.relatedTarget).data('harga'));
})

$('#formBeli').submit(function (event) {
    event.preventDefault();
    var fail = false,
        fail_log = '',
        name;

    $('#formBeli').find('select, textarea, input').each(function () {
        if (!$(this).prop('required')) { //
        } else {
            if (!$(this).val()) {
                fail = true;
                name = $(this).attr('name');
                fail_log += name + " is required \n";
            }
        }

        if (!fail) {
            kirimWA();
            return false;
        }
    });
});

// Inisialisasi Form WA
var parameter = '';
var url_wa = 'https://api.whatsapp.com/send';
if (/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent)) {
    url_wa = 'whatsapp://send';
}
var kode_area = 62,
    list_nomor_whatsapp = ['8128888560', '8993131808', '81220787988'],
    nama_admin = 'Kang Rian',
    pesan_salam = 'Assallamu`alaikum';
var w = 960,
    h = 540,
    left = Number((screen.width / 2) - (w / 2)),
    tops = Number((screen.height / 2) - (h / 2));
// ---------------------------

function kirimWA() {
    var paket = $('#input_paket').val(),
        harga = $('#input_harga').val(),
        nama = $('#nama').val(),
        pesan = $('#pesan').val();

    var parameter = url_wa + '?phone=' + kode_area + list_nomor_whatsapp[Math.floor(Math.random() * list_nomor_whatsapp.length)] + '&text=' +
        pesan_salam + ' ' + nama_admin + '.. ' +
        'saya *' + nama + '*, ingin *membeli Jasa WA*.' +
        '%0A Nama Paket : ' + paket +
        '%0A Harga : ' + harga +
        '%0A%0A Nama : ' + nama +
        '%0A Pesan : ' + pesan + '%0A%0A' +
        'Via : http://zajmar.com/';

    popupWindow = window.open(parameter, '', 'toolbar=no, location=no, directories=no, status=no, menubar=no, scrollbars=yes, resizable=1, copyhistory=no, width=' + w + ', height=' + h + ', top=' + tops + ', left=' + left);
    popupWindow.focus();
    $(this).attr('href', parameter);
    $("#modalBeli").modal("hide");
    return false;
}

